class MakeImage:
    def __init__(self, str, com):
        self.str = str
        self.com = com

    def getImage(self):
        if self.com == 'play':
            return self.getPlay()
        elif self.com  == 'pause':
            return self.getPause()
        elif self.com  == 'stop':
            return self.getStop()
        elif self.com  == 'amm':
            return self.getAMM()
        elif self.com == 'spotify':
            return self.getSpotify()
        elif self.com == 'settings':
            return self.getSettings()
        else:
            return self.getb64()

